    #loader-wrapper {
      width: 100%;
      height: 100%;
      background: #35c4e6;
    }


    @keyframes loader-logo-anim {
      50% {
        transform: rotate(180deg);
      }

      80% {
        transform: rotate(280deg);
      }

      100% {
        transform: rotate(360deg);
      }
    }

    #loader-wrapper .load_item {
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      text-align: center;
    }

    #loader-wrapper .load_title {
      color: #fff;
      font-size: 22px;
      margin-top: 50px;
      letter-spacing: 2px;
      white-space: nowrap;
      /*animation: loader-text-shake 2s linear  infinite;*/
    }

    /* 滚动条优化 start */
    ::-webkit-scrollbar {
      width: 8px;
      height: 8px;
    }

    ::-webkit-scrollbar-track {
      background: #f6f6f6;
      border-radius: 2px;
    }

    ::-webkit-scrollbar-thumb {
      background: #cdcdcd;
      border-radius: 2px;
    }

    ::-webkit-scrollbar-thumb:hover {
      background: #747474;
    }

    ::-webkit-scrollbar-corner {
      background: #f6f6f6;
    }


    /* 滚动条优化 end */
  </style>

      </div>
    </div>
  </div>
